export interface IDoctor {
    doctor_id: number;
    name: string;
    description: string;
    price: number;
    picture: string;
    rating: number;
    location: string;
    updated_at?: string; // Додайте це поле
}

export const defaultDoctor: IDoctor = {
    doctor_id: 0,
    name: '',
    description: '',
    price: 0,
    picture: '',
    rating: 0,
    location: '',
    updated_at: undefined
};
